<style>
body {
  background-color: #fdf6f9; /* Slightly off-white background */
  color: #333;
  font-family: 'Georgia', serif; /* Classic font for magazine feel */
  margin: 0;
  padding: 0;
  text-align: center; /* Center everything */
  line-height: 1.8; /* Increase line spacing */
  font-size: 18px; /* Slightly larger font size */
}

/* Headings styling */
h1 {
  color: #ff66cc; /* Bright pink for main titles */
  font-size: 2.5em; /* Stand-out title size */
}

h2 {
  color: #cc66ff; /* Purple for subtitles */
  font-size: 2em;
  margin-bottom: 0.5em;
}

/* Paragraphs */
p {
  color: #5555ff; /* Blue text for paragraphs */
  font-size: 1.2em;
  margin: 0 auto;
  max-width: 800px; /* Keep paragraphs narrow for readability */
  text-align: justify; /* Align text neatly */
}

/* Topic-specific coloring */
[data-topic="science"] {
  color: #4c5cff; /* Cool blue for science topics */
}

[data-topic="history"] {
  color: #8a4cff; /* Deep purple for history topics */
}

[data-topic="math"] {
  color: #ff4c4c; /* Soft red for math topics */
}

/* Floating T-rex styling */
.trex {
  position: absolute;
  width: 120px; /* Bigger T-rex size */
  opacity: 0.5; /* Semi-transparent */
  animation: float 15s infinite; /* Slower floating animation */
  z-index: 10;
}

/* Cursor egg */
body {
  cursor: url('egg-cursor.png'), auto;
}

/* Floating animation */
@keyframes float {
  0% {
    transform: translateY(0);
  }
  50% {
    transform: translateY(-30px);
  }
  100% {
    transform: translateY(0);
  }
}
</style>
&lt;<script type="text/javascript">
  function addTrex() {
  const trex = document.createElement('img');
  trex.src = 'trex.png';
  trex.alt = 'Floating T-rex';
  trex.className = 'trex';
  trex.style.top = `${Math.random() * 100}%`;
  trex.style.left = `${Math.random() * 100}%`;
  document.body.appendChild(trex);
}

// Generate T-rexes every 10 seconds
setInterval(addTrex, 10000);
</script>
